import React from "react";
import "./App.css";
import HomePage from "./pages/homepage/homepage";
import { BrowserRouter, Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Route path="/" component={HomePage} />
        <Route path="/Hats" component={HomePage} />
      </BrowserRouter>
    </div>
  );
}

export default App;
